"     </a>",
"     <br/>",
"     <a class=\"medical medical_patient\" href=\"UTD.htm?7/28/7620?source=see_link\">",
"      Patient information: Permanent sterilization procedures for women (Beyond the Basics)",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_patient\" href=\"UTD.htm?29/2/29730?source=see_link\">",
