"     </a>",
"     <br/>",
"     <a class=\"medical medical_review\" href=\"UTD.htm?41/13/42201?source=see_link\">",
"      Contraception: Overview of issues specific to adolescents",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_review\" href=\"UTD.htm?31/5/31833?source=see_link\">",
