var title_f23_32_24075="RTOG acute morbidity crit";
var content_f23_32_24075=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F64833&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=0\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F64833&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=0\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    The RTOG acute radiation morbidity scoring criteria",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Grade I",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Fully functional status (ie, able to work) with minor neurologic findings, no medication needed",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Grade II",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Neurologic findings present sufficient to require home care",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Nursing assistance may be required",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Medications including steroids/anti-seizure agents may be required",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Grade III",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Neurologic findings requiring hospitalization for initial management",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Grade IV",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Serious neurologic impairment which includes paralysis, coma or seizures more than three times per week despite medication",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hospitalization required",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Grade V",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Any toxicity that causes death",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Modified from: www.rtog.org/members/toxicity/acute.html.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
