var title_f23_32_24076="ESC bridging therapy";
var content_f23_32_24076=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F56916&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F56916&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    European Society of Cardiology guideline summary: Bridging therapy in patients with mechanical valves who require interruption of warfarin therapy for noncardiac surgery or other procedure",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Risk stratification for thromboembolism risk is essential. High risk is defined as one or more of the following; the risk increases with the number of risk factors present:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1_start\" colspan=\"1\">",
"       &bull; Risk factors for thromboembolism, especially if multiple. Risk factors include:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       1. Atrial fibrillation",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       2. A prior history of thromboembolism",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       3. Heart failure or a left ventricular ejection fraction &le;30 percent",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       4. A hypercoagulable state",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       &bull; A mechanical valve in the mitral position.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"1\">",
"       &bull; Mechanical valves known to be associated with a high risk of valve thrombosis if the INR is low (Lillehei Kaster, Omniscience, Starr Edwards).",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"1\">",
"       &bull; Surgery for cancer or an infection, both of which can be associated with a hypercoagulable state.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       The following approach is recommended based upon risk stratification for both thromboembolism and the risk of bleeding, which varies with the site of surgery:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"1\">",
"       &bull; For very high-risk patients, anticoagulation should not be interrupted if possible.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"1\">",
"       &bull; Interruption of anticoagulation is not necessary for many minor surgical procedures, including dental extraction, and for procedures where bleeding can be easily controlled. In such patients, the INR should be lowered to a goal of 2.0 and surgical homeostasis should be meticulous.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1_start\">",
"       &bull; If anticoagulation must be interrupted:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       1. The patient should be admitted to the hospital and warfarin discontinued",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       2. Intravenous unfractionated heparin (goal aPTT 1.5 to 2.0) should be started as the INR gradually falls. The safety of subcutaneous low molecular weight heparin started at home has not been established.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       3. Heparin and warfarin should be resumed as soon as possible after surgery; heparin is continued until the INR is within the goal therapeutic range.",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Butchart EG, Gohlke-Barwolf C, Antunes MJ, et al. Recommendations for the management of patients after heart valve surgery. Eur Heart J 2005; 26:2463.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
