" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 489px\">",
"   <div class=\"ttl\">",
"    Long-term mortality in patients undergoing AVR",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 469px; height: 262px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
