var title_f23_32_24078="LV mass LVEF outcome";
var content_f23_32_24078=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F77947&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F77947&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 517px\">",
"   <div class=\"ttl\">",
"    Left ventricular mass is an independent predictor of mortality",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 497px; height: 294px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    In the SOLVD trials of 1172 patients with left ventricular (LV) dysfunction, Kaplan-Meier survival curves demonstrate that increased LV mass &ge;298 g is an independent risk factor for all-cause mortality (p = 0.0014); a one standard deviation increase in LV mass is associated with a 17 percent increased risk of death. A LV ejection fraction (LVEF) &ge;35 percent, however, is protective in those with LV mass &ge;298 g.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Quinones MA, Greenberg BH, Kopelen HA, et al, for the SOLVD Investigators. J Am Coll Cardiol 2000; 35:1237.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
